from mymusic import MyMusicCatalogimport pytestdef test_mymusiccatalog():    mymc = MyMusicCatalog(mkDirs=False)    assert isinstance(mymc, MyMusicCatalog), "Sanity check for MyMusicCatalog"        mpds = mymc.get_matched_prime_dirs(check_exists=False)    assert isinstance(mpds, dict), "Could not get matched prime dirs"            @pytest.mark.slowdef test_mymusiccatalog_dirs_exist():    mymc = MyMusicCatalog(mkDirs=False)    assert isinstance(mymc, MyMusicCatalog), "Sanity check for MyMusicCatalog"        mpds = mymc.get_matched_prime_dirs(check_exists=True)    assert isinstance(mpds, dict), "Could not get matched prime dirs"            @pytest.mark.slowdef test_mymusiccatalog_find_artists():    mymc = MyMusicCatalog()    mymc.find_artist_dirs(test=True)